script: |
  super -f tsv -I q1989.sql | sort > q1989.out

vector: true

inputs:
  - name: q1989.sql
    data: |
      SELECT col0 AS col2 FROM tab2 WHERE + col0 IS NOT NULL GROUP BY col1, col0 HAVING NOT ( + - col1 ) IS NULL;
  - name: tab2

outputs:
  - name: q1989.out
    data: |
      15
      91
      92
